import React, { useState, useEffect } from 'react';

const MapFoodSangHyeon = () => {
  const [selectedRestaurant, setSelectedRestaurant] = useState(null);
  const [map, setMap] = useState(null);
  const [markers, setMarkers] = useState([]);
  const [selectedFoodType, setSelectedFoodType] = useState([]);

  useEffect(() => {
    const script = document.createElement('script');
    script.src =
      'https://dapi.kakao.com/v2/maps/sdk.js?appkey=0560729fbda53d06035a69b6f812c484&libraries=services';
    script.async = true;
    script.onload = () => {

      const mapOptions = {
        center: new window.kakao.maps.LatLng(37.297764, 127.069340),
        level: 2,
      };

      const mapInstance = new window.kakao.maps.Map(
        document.getElementById('map'),
        mapOptions
      );
      setMap(mapInstance);

      const positions = [
        {
          title: '계경',
          latlng: new window.kakao.maps.LatLng(37.297764, 127.069340),
          type: ['한식'],
          number: '041-541-1444',
          menu: '부대찌개, 콩불',
        },      
      ];

      setMarkers(
        positions.map((position) => {
          const marker = new window.kakao.maps.Marker({
            position: position.latlng,
            map: mapInstance,
          });
          const infowindow = new window.kakao.maps.InfoWindow({
            content: `<div style="padding:5px;">${position.title}</div>`,
            removable: true,
          });

          window.kakao.maps.event.addListener(marker, 'click', () => {
            infowindow.open(map, marker);
            setSelectedRestaurant(position);
          });

          return { ...position, marker, infowindow };
        })
      );
    };

    document.head.appendChild(script);
  }, []);

  const handleFoodTypeClick = (foodType) => {
    if (selectedFoodType.includes(foodType)) {
      setSelectedFoodType(selectedFoodType.filter((type) => type !== foodType));
    } else {
      setSelectedFoodType([foodType]);
    }
  };

  useEffect(() => {
    if (map) {
      markers.forEach((marker) => {
        const isVisible =
          selectedFoodType.length === 0 || selectedFoodType.some((type) => marker.type.includes(type));
        marker.marker.setMap(isVisible ? map : null);
      });
    }
  }, [map, selectedFoodType, markers]);

  return (
    <div>
      <div id="map" style={{ width: '100%', height: '500px', margin: '0 auto' }}></div>
      {selectedRestaurant && (
        <div className="restaurant-info">
        <h3>{selectedRestaurant.title}</h3>
        <p>전화번호: {selectedRestaurant.number}</p>
        <p>대표메뉴: {selectedRestaurant.menu}</p>
      </div>
      )}
      <div className="food-type-buttons">
        <button onClick={() => handleFoodTypeClick('')} className={selectedFoodType === 0 ? 'active' : ''}>
          전체
        </button>
        <button onClick={() => handleFoodTypeClick('한식')} className={selectedFoodType === '한식' ? 'active' : ''}>
          한식
        </button>
        <button onClick={() => handleFoodTypeClick('중식')} className={selectedFoodType === '중식' ? 'active' : ''}>
          중식
        </button>
        <button onClick={() => handleFoodTypeClick('일식')} className={selectedFoodType === '일식' ? 'active' : ''}>
          일식
        </button>
        <button onClick={() => handleFoodTypeClick('양식')} className={selectedFoodType === '양식' ? 'active' : ''}>
          양식
        </button>
        <button onClick={() => handleFoodTypeClick('패스트푸드')} className={selectedFoodType === '패스트푸드' ? 'active' : ''}>
          패스트푸드
        </button>
        <button onClick={() => handleFoodTypeClick('분식')} className={selectedFoodType === '분식' ? 'active' : ''}>
          분식
        </button>
        <button onClick={() => handleFoodTypeClick('기타')} className={selectedFoodType === '기타' ? 'active' : ''}>
          기타
        </button>
      </div>
    </div>
  );
};

export default MapFoodSangHyeon;
